As a part of Black Quantum Futurism's @blackwomxntemporal Portal project Black Womxn Time Camp (004) is ONLINE this year on sept 20 and 27 as a two-day long program exploring time, alternative temporalities, time travel, and temporal shifts from the frameworks, rituals, and cultural traditions of self-identifying Black women, femmes, girls, non-binary, and gender non-conforming folks. The program includes a tea ceremony and over 20 workshops, presentations and portals from local, national, and international presenters, including Morena Espiritual, Hannah I. Place, AnAkA, Karine Fleurima, Almah LaVon Rice, Soliana Habte, Black Quantum FUturism, Imani Harmon, Xenobia Bailey, Ingrid Raphael, dynanism, Chanelle Adams, Janine Francois, Jasmine Newton, Tonika Berkley, Joy KMT, Camae Ayewa, DSM 215 Collective, Womanist Working Collective,  Christina Springer, Jasmine Hearn + Angie Pittman, and Antônia Gabriela Araújo. Full schedule and tickets available at: https://www.blackwomxntemporal.net/timecamp4

